INSERT INTO `news` (`id`, `title`, `text`, `image_name`, `created_at`, `updated_at`) VALUES
(9, 'Taxe foncière : dans quels cas pouvez-vous être exonéré ?', 'Propriétaires, vous allez recevoir de manière imminente votre avis de taxe foncière 2023. À partir du 30 août, en effet, l’administration fiscale procède à l’envoi des premiers documents aux contribuables. Pour rappel, la taxe foncière est un impôt local dont doivent s’acquitter les propriétaires de biens immobiliers, ou les usufruitiers. Elle concerne à la fois les propriétés bâties (appartement, maison, parking, dépendance, etc.) et les propriétés non bâties (terrains, prés, terres agricoles, etc.). L’avis de taxe foncière contient par ailleurs de multiples taxes locales, telles que la taxe sur les ordures ménagères ou encore la “taxe inondation”, appelée taxe Gemapi.\r\n\r\nIl existe toutefois des cas de figure où les propriétaires peuvent être exonérés de taxe foncière. Cette exonération peut être partielle ou totale, et elle ne concerne pas les autres impôts locaux. Voici une synthèse de ces situations.\r\nLes principaux cas d’exonération totale\r\n\r\nSont d’abord exonérés intégralement de taxe les propriétaires répondant à l’un des critères suivants :\r\n\r\nLes foyers bénéficiaires de l’Allocation supplémentaire d\'invalidité (ASI) sans condition de ressource ;\r\nLes bénéficiaires de l’Allocation de solidarité aux personnes âgées (Aspa), anciennement connu sous le nom de minimum vieillesse.\r\n\r\nPar ailleurs - et sous conditions de ressources présentées ci-dessous - les ménages suivants peuvent également profiter d’une exonération totale :\r\n\r\nLes personnes âgées de plus de 75 ans. Ces ménages peuvent par ailleurs profiter en sus d’une exonération de taxe foncière pour leur résidence secondaire.\r\n\r\nLes titulaires de l\'Allocation aux adultes handicapés (AAH).\r\n\r\nPour ces deux types de profils, l’exonération s’appliquera à condition que le revenu fiscal de référence ne dépasse pas les seuils suivants : 11.885 euros pour la première part de quotient familial, auxquels il faut ajouter 3.174 euros pour chaque demi-part supplémentaire en métropole. Les plafonds diffèrent toutefois en outre-mer.\r\n\r\nÀ noter que pour les couples mariés, la condition d\'âge ou de handicap peut n\'être remplie que par un seul des deux conjoints. Il faut toutefois que le logement appartienne à la communauté conjugale, ou qu’il soit un bien propre de la personne âgée ou handicapée. Il n’y a en théorie besoin d’aucune démarche administrative pour obtenir ces exonérations, dès lors que les critères sont remplis.\r\nLe plafonnement possible des plus de 65 ans\r\n\r\nSi l’âge du propriétaire est compris entre 65 ans et moins de 75 ans au 1er janvier d’imposition, alors l’administration peut accorder un dégrèvement de taxe foncière d’un montant 100 euros (sur la résidence principale), appliqué d’office. Ce dégrèvement est toutefois conditionné au niveau de ressources du bénéficiaire, en fonction des mêmes plafonds présentés plus hauts.\r\nL’exonération temporaire pour les logements neufs\r\n\r\nSi vous achetez un logement neuf ou en contrat VEFA (vente en l\'état futur d\'achèvement, ou achat sur plan), vous pouvez être exonéré de taxe foncière pendant les deux ans qui suivent l\'achèvement des travaux. Pour bénéficier de cette exonération, toutefois, il sera nécessaire de déclarer sous 90 jours la construction une fois celle-ci terminée. Pour une maison neuve, il vous faudra faire parvenir à votre centre des finances publiques une déclaration de modèle H1, formulaire 6650. Pour un appartement neuf, il faudra envoyer une déclaration de modèle H2, formulaire 6652. Sans cette déclaration, vous ne pouvez profiter de l’exonération !\r\n\r\nL’exonération sous condition pour les logements vacants\r\n\r\nIl est possible pour un propriétaire bailleur d’être exonéré de la taxe foncière, si le logement est vacant, et se trouve normalement destiné à la location. L’administration fiscale explique qu’il faut alors, pour profiter de l’exonération, présenter une réclamation au centre des finances publiques dont dépend le logement. L’exonération peut alors être accordée, à une triple condition :\r\n\r\nLa vacance locative ou l’inexploitation du logement doit être involontaire de la part du propriétaire ;\r\nLa situation doit durer depuis au moins 3 mois ;\r\nElle affecte soit la totalité de l’immeuble, soit une partie susceptible de location ou d’exploitation séparée.\r\n\r\nLa réclamation doit être présentée au plus tard le 31 décembre de l’année qui suit la période minimale de vacance. Cette réclamation peut donner lieu, en sus de la taxe foncière, à l\'exonération des taxes locales annexes telles que la taxe sur les ordures ménagères.', 'logement-taxe-fonciere-64f0d51aac2e3112187329.jpg', '2023-08-26 19:36:46', '2023-08-31 19:59:53'),
(10, 'Logements sociaux : pourquoi ils vont être encore plus difficiles à obtenir en Île-de-France', 'Les bailleurs sociaux alertent sur le manque d’offres de location en Île-de-France, principalement en raison de l’érosion du nombre de nouvelles constructions. Dans la région, la crise du logement devrait s’aggraver en 2024, en particulier pour ce type d’habitat.\r\n\r\nEn Île-de-France, seulement une demande de logement social sur dix est satisfaite chaque année. Voilà ce que rapporte l’Association des organismes de logement social d\'Île-de-France (AORIF) en cette fin d’été. La fédération, qui rassemble une centaine de bailleurs sociaux en région parisienne, dénonce ainsi l’importante crise du logement qui se traduit aujourd’hui par des difficultés d’accès accrues à la propriété ou à la location. Et encore davantage pour le logement social, dont les places deviennent de plus en plus rares en région parisienne. “On attribue environ 70.000 logements sociaux par an, alors que nous avons 780.000 demandeurs”, présente ainsi Damien Vanoverschelde, le président de l’AORIF.\r\n\r\nOr “le nombre de demandeurs est en croissance”, rapporte-t-il : 100.000 de plus depuis 5 ans ! “L’État ne semble pas prendre la pleine mesure de la crise du logement dans la région”, appuie Jean-François le Neen, chargé de mission Île-de-France pour la Fondation Abbé Pierre. “Désormais, on compte 1,3 million de mal-logés, soit 10% de la population francilienne. Or derrière ces chiffres, on trouve des familles qui vivent dans des conditions indignes, avec des conséquences importantes dans leur vie.”\r\n\r\nLe problème ? Le manque de construction neuve\r\n\r\nAux yeux des bailleurs sociaux, l’impasse dans laquelle se trouvent de nombreux demandeurs provient donc de la difficulté des organismes à répondre aux nouveaux besoins. Le nombre de constructions de nouveaux logements sociaux, en effet, ne cesse de reculer. L’AORIF comptait ainsi 36.000 agréments de nouveaux logements en 2016, mais seulement 21.800 en 2022. Pire encore : en 2023, l’association prévoit des résultats compris entre 17.000 et 19.000 nouveaux logements. Un chiffre très insuffisant, aux yeux des organismes sociaux, pour répondre à la demande. “L’objectif régional est pourtant de construire 37.000 logements sociaux par an”, rappelle ainsi Damien Vanoverschelde.\r\n\r\nLes bailleurs sociaux, comme l’ensemble des promoteurs immobiliers, subissent une très violente crise de la construction. Celle-ci se traduit par une dégringolade du nombre de permis de construire délivrés depuis plusieurs mois, ainsi qu’un effondrement du nombre de ventes de logements neufs. Ces difficultés trouvent notamment leur source dans la raréfaction des terrains constructibles en Île-de-France, qui fait flamber le prix du foncier. Mais aussi dans l’envolée des coûts de construction, dopés eux-mêmes par l’augmentation des prix des matériaux en sortie de crise du Covid-19.\r\n\r\nDes propositions pour tenter de résoudre la crise\r\n\r\nLes bailleurs sociaux franciliens préconisent donc une série de vingt mesures pour tenter de relancer la construction, et désengorger les files d\'attente. Parmi elles, revenir à l’application d’une TVA au taux de 5,5% sur les prix de livraison de logements sociaux, contre 10% actuellement pour de nombreux types d’opérations. Ils souhaitent par ailleurs pouvoir acquérir des logements énergivores bientôt interdits à la location, à des conditions financières avantageuses. Ou encore réformer la fiscalité des terrains constructibles, afin de lutter contre la rétention foncière (le fait de refuser de vendre son terrain, en spéculant sur une flambée de sa valeur).\r\n\r\nIls souhaitent par ailleurs pérenniser l’exonération de taxe sur les plus-values immobilières en cas de cession d’un terrain à un organisme de logement social. “Nos propositions s’adressent aux décideurs franciliens, nationaux et aux parlementaires”, relaie Anne-Katrin le Doeuff, la directrice de l’AORIF. Reste à savoir si ces derniers les porteront dans le débat public, et notamment dans le projet de loi de finances pour 2024, examiné à l’automne au Parlement.', 'logements-sociaux-64f0d31f6246a778948397.jpg', '2023-08-26 19:40:26', '2023-08-31 19:51:26'),
(11, 'Acheter un mobil-home : bon plan ou investissement piégeux ?', 'A première vue, l’affaire paraît intéressante. Pour des particuliers sans importants moyens financiers et rêvant d’un pied-à-terre pour les vacances, l’achat d’un mobil-home constitue une piste à étudier. Au-delà du prix – entre 35.000 et 65.000 euros en moyenne pour un modèle neuf, deux fois moins en occasion –, ce genre de logement, à mi-chemin entre la caravane et la maison, offre l’avantage d’être exonéré de frais de notaire mais aussi de taxe foncière ou d’habitation. «En plus, leur confort s’est nettement amélioré ces dernières années, estime Roger, un retraité propriétaire dans les Landes d’un modèle avec deux salles de bains, deux toilettes, la climatisation et une terrasse. «J’y passe chaque vacance scolaire avec mes enfants et petits-enfants pour leur plus grande joie.»\r\n\r\nSi le succès des mobil-homes ne se dément pas – le parc détenu par les particuliers est estimé autour de 200.000 et les ventes neuves annuelles proches de 4.000 –, leur achat mérite toutefois de rester classé dans la catégorie «plaisir», au même titre qu’une voiture ou qu’un camping-car. «N’espérez pas trop en revanche gagner de l’argent avec», prévient Michel Harismendy, président de la Fédération nationale de propriétaires de résidences de loisirs (FNPRL). Il est vrai que les chausse-trapes ne manquent pas. Déjà, pas question de s’installer n’importe où. A de rares exceptions près, la loi impose l’implantation soit dans des campings, soit dans des parcs résidentiels de loisirs, des copropriétés touristiques peu nombreuses en France.\r\n\r\nUn loyer annuel de 3 000 à 6 000 euros en général à prévoir pour la parcelle\r\n\r\nDans les faits, un particulier intéressé s’adressera donc à un camping ayant des mobil-homes disponibles (ou plus rarement des places vides) ou à des revendeurs spécialisés, souvent en cheville avec des gestionnaires de camping. Le prix global tiendra compte à la fois du transport du mobil-home sur le site et de son installation, avec le calage et les branchements techniques. Attention : «Vous ne serez jamais propriétaire de la parcelle sur laquelle vous êtes implanté», avertit Franck Collin, de l’association Familles rurales. Comptez un loyer annuel qui varie généralement de 3.000 à 6.000 euros selon le niveau de gamme du camping et sa situation géographique, mais aussi des frais d’eau et d’électricité, dont la facturation peut parfois poser des problèmes.\r\n\r\nPour rentabiliser cet investissement, vous pourriez être tenté de le louer, d’autant qu’une semaine à la mer se facture ­d’ordinaire entre 1.000 et 1.500 euros. Mais très peu de campings acceptent une sous-location directe. La plupart préfèrent logiquement s’en occuper eux-mêmes, en imposant les tarifs et en prenant, bien sûr, au passage une copieuse commission. «Au-delà de 30%, fuyez», conseille Laurent Portier, président de l’Association des propriétaires de mobil-homes de France.\r\n\r\nAutre désagrément : après quinze à vingt ans de présence, des gestionnaires appliquent des clauses d’ancienneté, contraignant les propriétaires à changer leur bien ou à quitter les lieux à leurs frais. Quant à la revente, inutile alors d’en espérer beaucoup. «Le problème est que tout repose sur des contrats pouvant être revus régulièrement et unilatéralement par les campings», se désole Michel Harismendy. D’où une épée de Damoclès sur la tête du détenteur de mobil-home, même si le premier document signé s’avère correct. Dernier risque : nombre de campings font miroiter le fait de pouvoir bénéficier du statut fiscalement avantageux de loueur en meublé non professionnel (LMNP). Or, s’il demeure déplaçable, un mobil-home n’est pas considéré comme un bien immobilier. «Le fisc pourrait estimer que le LMNP ne peut pas s’appliquer», alerte Paul Duvaux, avocat fiscaliste. Prudence…\r\n\r\nCe qu\'il faut prendre en compte avant d\'acheter un mobil-home :\r\n\r\nLa durée du contrat : généralement prévu pour deux ans, le contrat entre le camping et le propriétaire peut être revu avec des conditions nettement moins avantageuses.\r\nLes frais divers en plus : taxes de séjour pour la famille ou les amis, travaux d\'aménagement du mobil-home par des prestataires imposés....Certaines clauses sont très contestables.\r\nLe critère d\'ancienneté : au motif de garder un site joli et moderne, de nombreux campings exigent des propriétaires qu\'ils changent leur mobil-home au bout de quinze ou vingt ans.', 'mobil-home-bon-plan-64f0d1b7e6697301765184.jpg', '2023-08-26 19:51:33', '2023-08-31 19:45:27'),
(12, 'Assurance immobilière… Tout ce qui a changé en juin 2023 !', 'En juin, plusieurs changements importants ont été mis en place. Résiliation en 3 clics, taux d’usure, plafonnement des loyers… Découvrez ces évolutions qui impactent directement votre quotidien et vos projets immobiliers.\r\n\r\nVous pouvez résilier vos contrats d\'assurance en 3 clics !\r\n\r\nDepuis le 1er juin, vous pouvez désormais résilier vos contrats d’assurance par voie électronique bien simplement qu’auparavant pour profiter d\'offres plus avantageuses pour votre pouvoir d’achat. Appelée résiliation « en trois clics », cette nouvelle mesure s’applique aux contrats d’assurance conclus en ligne, aussi bien les contrats à venir que les contrats souscrits avant le 1er juin. Cette procédure de résiliation simplifiée concerne les contrats d’assurance couvrant les personnes physiques en dehors de leurs activités professionnelles : assurance habitation, assurance auto, complémentaire santé… et assurance emprunteur, dont la résiliation avait déjà été favorisée par la loi Lemoine.\r\n\r\nToutes les compagnies d’assurance, les mutuelles et les institutions de prévoyance doivent donc désormais faire apparaitre un bouton facilement repérable sur leur site avec la mention « Résilier votre contrat » ou une formule similaire « dénuée d\'ambiguïté, affichée en caractères lisibles ». Pour résilier votre contrat, vous aurez seulement à renseigner certaines informations : nom et prénom, moyen de contact, référence du contrat, motif de la résiliation et date de l\'événement donnant lieu à résiliation. Un récapitulatif vous sera ensuite présenté et vous aurez juste à confirmer votre demande.', 'key-5284793-1280-64f0d02888356493814766.png', '2023-08-27 10:07:32', '2023-08-31 19:38:47'),
(15, 'Quels sont les quartiers les plus bruyants de Paris ?', 'Lorsque l\'on vit en ville, le niveau de bruit peut être un facteur important à prendre en compte pour choisir son lieu de résidence. À Paris, certaines zones sont réputées pour être plus bruyantes que d\'autres en raison de divers facteurs tels que la densité de population, le trafic routier et les activités commerciales. Voici quels sont les quartiers les plus bruyants de Paris.\r\n\r\nLe 18e arrondissement : le quartier le plus bruyant\r\n\r\nLe 18e arrondissement de Paris présente une intensité sonore de 59,1 décibels (dB), ce qui en fait l\'un des arrondissements les plus bruyants de la capitale. Situé dans le nord de Paris, le 18e arrondissement englobe des quartiers tels que la Goutte d\'Or et la Chapelle. Cette forte intensité sonore est principalement attribuée à la grande concentration de terrasses, de restaurants et de bars dans ces zones. Les activités nocturnes et le flux constant de personnes peuvent également générer un niveau de bruit élevé.\r\n\r\nLe 17e arrondissement : du bruit lié à la construction\r\n\r\nLe 17e arrondissement de Paris se classe également parmi les arrondissements les plus bruyants, avec une intensité sonore de 56,5 dB. Plus précisément, le quartier de Batignolles est identifié comme l\'environnement le plus bruyant de cet arrondissement. Cela peut être attribué à l\'aménagement de la ZAC Clichy-Batignolles, qui a apporté des changements significatifs au paysage urbain de l\'endroit. Les modifications urbaines et les activités de construction contribuent fortement à l\'augmentation du bruit ambiant, ce qui peut affecter le confort acoustique des logements.\r\n\r\nLe 7e arrondissement de Paris : du tourisme bruyant\r\n\r\nBien qu\'étant un quartier prestigieux situé près de la tour Eiffel et du Champ-de-Mars, le 7e arrondissement de Paris présente également une intensité sonore notable de 55,7 dB. Cette concentration de bruit se trouve principalement dans le quartier du Gros-Caillou, où quelques artères principales traversent la zone. Les véhicules circulant dans ces rues principales engendrent un niveau de bruit plus élevé par rapport à d\'autres parties de l\'arrondissement.', 'paris-quartiers-bruyants-seloger-jpg-64f0ce0f014b8646580192.webp', '2023-08-31 13:44:33', '2023-08-31 19:29:50');

