--
-- Structure de la table `property`
--

DROP TABLE IF EXISTS `property`;
CREATE TABLE IF NOT EXISTS `property` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` longtext COLLATE utf8mb4_unicode_ci,
  `surface` int(11) NOT NULL,
  `rooms` int(11) NOT NULL,
  `bedrooms` int(11) NOT NULL,
  `floor` int(11) NOT NULL,
  `price` int(11) NOT NULL,
  `heat` int(11) NOT NULL,
  `city` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `address` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `postal_code` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `sold` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` datetime NOT NULL COMMENT '(DC2Type:datetime_immutable)',
  `updated_at` datetime DEFAULT NULL COMMENT '(DC2Type:datetime_immutable)',
  `latitude` double NOT NULL,
  `longitude` double NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Déchargement des données de la table `property`
--

INSERT INTO `property` (`id`, `title`, `description`, `surface`, `rooms`, `bedrooms`, `floor`, `price`, `heat`, `city`, `address`, `postal_code`, `sold`, `created_at`, `updated_at`, `latitude`, `longitude`) VALUES
(91, 'Maison avec grand salon, 2 chambres', 'Maison à 10km de Machecoul, au calme avec vue sur les champs, maison ancienne à étage d\'environ 44m² habitable sur une parcelle de 224m² rénovée dans les années 2000, comprenant :\r\n- au rdc une grande cave, un garage réalisé en 2000.\r\n- à l\'étage une cuisine indépendante, un séjour d\'environ 18m², une chambre, une salle d\'eau et wc séparé.\r\nToiture tuile, chauffage électrique (ballon d\'eau 2018).\r\nHuisseries PVC DV, volets roulants.\r\nAssainissement autonome.\r\nTaxe foncière : 318€', 135, 3, 2, 1, 85000, 1, 'Conflans-Sainte-Honorine', 'Avenue Beauséjour', '78700', 0, '2023-08-24 05:18:38', NULL, 49.010521, 2.112587),
(92, 'Petit Appartement 2 pièces', 'Appartement la grande motte 2 pièces 17.06m², dans résidence avec piscine, proche de la plage et des commerces. Studio cabine en rez de chaussé, en bon état avec balcon donnant sur le parc. Vendu meublé avec un parking extérieur privé dans la résidence. Charges annuelles : 1380 euros.\r\nEtat général : Habitable\r\nSurface terrain : 3.26\r\nNuméro de mandat : 6151', 17, 1, 1, 1, 91500, 1, 'Saint-Arnoult-en-Yvelines', 'Allée de Trevoye', '78730', 0, '2023-08-24 05:18:38', NULL, 48.573456, 1.951046),
(93, 'Maison 9 pièces 176 m²', 'Brunoy, vous cherchez une maison solide avec de beaux volumes pour votre famille, celle-ci est faite pour vous. Au RDC: Entrée, séjour double ouvert sur véranda, cuisine aménagée et équipée ouverte sur terrasse, chambre, dégagement et wc. Au 1er étage: Palier, une chambre avec cabinet de toilettes, une chambre avec accès salle de bains, deux chambres avec salle d\'eau commune, wc. Au 2ème étage: Palier, dégagement/bureau avec mezzanine, deux chambres avec salle d\'eau et un wc. Sous-sol: Dégagement, chaufferie, cave à vin, atelier et garage de 34 m². Chaudière Gaz de 2018, double vitrage, Portail motorisé. Grand jardin arborée d\'environ 1509 m² avec piscine hors-sol!! Gare et centre-ville à 10 minutes à pieds!!', 176, 9, 7, 2, 389000, 1, 'Saint-Germain-en-Laye', 'Chemin de la Conduite Numéro 2', '78100', 0, '2023-08-24 05:18:38', NULL, 48.983959, 2.14468),
(94, 'Appartement moyen 40 m²', 'Mobil home de luxe de 2017 de 40 m² vendu meublé situé dans un hôtel de plein air de cinq étoiles à Merlimont sur une parcelle de 140m² avec une place de parking. Comprenant un séjour, salle à manger, cuisine ouverte entièrement équipée, une terrasse couverte de 11 m2 donnant sur la pièce principale, une suite parentale avec sa salle de douche et WC, 2 chambres , salle d\'eau et WC séparé. Chauffage électrique. Très bon rapport qualité prix.', 40, 4, 3, 1, 57000, 1, 'Bougival', 'Avenue des Fauvettes', '78380', 0, '2023-08-24 05:18:38', NULL, 48.866901, 2.15275),
(95, 'Grande maison 5 pièces 184 m²', 'Maison T5 de 184,78 m2 utiles!! Elle se situe dans une impasse calme et tranquille. Elle se compose au premier niveau d\'une cuisine équipée semi-ouverte donnant sur une grande pièce de vie de 19,43 m2, de 2 chambres et un bureau, une SDE et un WC séparé. A l\'étage une grande chambre ainsi qu\'un coin détente. Vous aurez aussi un sous-sol complet avec buanderie et SDE, il est divisé en plusieurs pièces qui pourront être utilisées de façons diverses. le tout sur un terrain clôturé de de 779m2. Vous aurez également un garage et un coin terrasse.', 184, 5, 4, 1, 485000, 2, 'Rambouillet', 'Place de l\'Europe', '78120', 0, '2023-08-24 05:18:38', NULL, 48.648006, 1.8566999),
(96, 'Maison ancienne 7 pièces', 'Maison ancienne dans un petit village, non loin du centre du village, à deux pas de son incroyable tour médiévale, belle bâtisse restaurée des années 1890.\r\nVous serez séduit par cette belle demeure de caractère en pierre d\'une surface totale de plus de 189m2 habitables et sa grange de 43m2 sur chacun des 3 niveaux .\r\nUne belle propriété semi-détachée très bien entretenue, dans un environnement calme.', 189, 7, 5, 2, 186000, 2, 'Épône', 'Route de Septeuil', '78680', 0, '2023-08-24 05:19:40', NULL, 48.930439, 1.790688),
(97, 'Belle maison avec garage', 'Sur la commune prisée de Verneuil-sur-Seine, à 5 min du centre ville, Belle maison parfaitement entretenue, édifiée sur une parcelle de terrain joliment paysagé et clos de 300 m².\r\nFonctionnelle et bien agencée, cette maison de 2005 est composée d\'un hall d\'entrée avec placard de rangement, d\'une belle pièce de vie spacieuse avec cheminée ouvrant sur deux terrasses, une cuisine indépendante entièrement équipée avec électroménager et d\'un sanitaire.', 182, 3, 2, 1, 230000, 2, 'Verneuil-sur-Seine', '2 Rue du Parc Blanc', '78480', 0, '2023-08-24 05:19:40', NULL, 48.981758, 1.9790649),
(98, 'Maison dans les bois', 'Maison 4 chambres 1 sallon et 1 salle de bain, avec garage, jardin, mezzanine, terrasse, alarme.\r\nA 5 minutes des écoles et 2 minutes de l\'autoroute, F5 de 160 m2, Pas en lotissement ni copropriété., aucune charge.\r\nMitoyenne en décalé donc pas de vis-à-vis de la terrasse. Petit jardin privatif mais vous profitez d\'un grand parc à l\'arrière de la maison pour vos enfants, entretenu par la mairie.', 160, 4, 4, 1, 90000, 2, 'Versailles', 'Allée des Petits Bois', '78000', 0, '2023-08-24 05:19:40', NULL, 48.807701, 2.1573551),
(99, 'Maison spacieuse avec jardin', 'Proche de la gare, Maison de type F6 ayant une belle terrasse ensoleillée. 1 sallon, 5 chambres, un espace cuisine et un coin salon de 38m².', 200, 6, 5, 2, 310000, 2, 'Limay', '1 Rue Jacques Louis Duvivier', '78520', 0, '2023-08-24 05:19:40', NULL, 48.996056, 1.7306629),
(100, 'Appartement moderne avec clim', 'Bel appartement dans un quartier calme. Accès parking. Appartement climatisé, 1 sallon et 4 chambres, 1 salle de bain. Commerces et air de jeu à proximité.', 145, 5, 4, 1, 125000, 1, 'Poissy', '5 Rue au Pain', '78300', 0, '2023-08-24 05:19:40', NULL, 48.930531, 2.0398099),
(101, 'Maison 5 pièces 76 m²', 'Maison T5 au coeur de Lisses, dans un quartier calme en impasse, idéalement située, non-loin des commerces et proche des grands axes ! Maison comprenant : une grande entrée avec placard, salon/salle à manger lumineux avec accès terrasse, cuisine aménagée équipée, WC. A l\'étage : un couloir avec placards dessert 2 chambres, un bureau pouvant faire office de chambre, salle de bains avec WC.\r\nGarage avec mezzanine, terrain de 191 m² entièrement clos sans vis à vis avec terrasse.', 76, 5, 4, 2, 269000, 1, 'Bonnières-sur-Seine', 'Avenue du Maréchal Gallieni', '78270', 0, '2023-09-01 08:03:22', NULL, 49.033745, 1.5748661);

